CREATE DEFINER=`root`@`localhost` PROCEDURE `CheckPassword` (IN `input_username` VARCHAR(127), IN `input_password` VARCHAR(127), OUT `is_valid` BOOLEAN)   BEGIN
    DECLARE stored_password VARCHAR(255);
    
    -- Lấy mật khẩu đã mã hóa từ cơ sở dữ liệu dựa trên tên người dùng
    SELECT password INTO stored_password
    FROM user
    WHERE user_name = input_username;
    
    -- So sánh mật khẩu đã mã hóa với mật khẩu người dùng nhập sau khi mã hóa
    IF stored_password = SHA2(input_password, 256) THEN
        SET is_valid = TRUE;
    ELSE
        SET is_valid = FALSE;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `EncryptPassword` (IN `input_username` VARCHAR(127), IN `input_password` VARCHAR(127))   BEGIN
    DECLARE existing_password VARCHAR(255);
    
    -- Kiểm tra xem tên người dùng đã tồn tại hay chưa
    SELECT password INTO existing_password
    FROM user
    WHERE user_name = input_username;

    -- Nếu tên người dùng chưa tồn tại, lưu mật khẩu đã mã hóa
    IF existing_password IS NULL THEN
        INSERT INTO user (user_name, password)
        VALUES (input_username, SHA2(input_password, 256));
    ELSE
        -- Nếu tên người dùng đã tồn tại, có thể cập nhật mật khẩu
        UPDATE user
        SET password = SHA2(input_password, 256)
        WHERE user_name = input_username;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `EncryptPasswordPlus` (IN `input_username` VARCHAR(127), IN `input_password` VARCHAR(127), IN `input_role` INT(5), IN `input_email` VARCHAR(127), IN `input_name` VARCHAR(127), IN `input_maquan` VARCHAR(11))   BEGIN
    DECLARE existing_password VARCHAR(255);
    
    -- Kiểm tra xem tên người dùng đã tồn tại hay chưa
    SELECT password INTO existing_password
    FROM user
    WHERE user_name = input_username;

    -- Nếu tên người dùng chưa tồn tại, lưu mật khẩu đã mã hóa và các thông tin bổ sung
    IF existing_password IS NULL THEN
        INSERT INTO user (user_name, password, role, email, name, maquan)
        VALUES (input_username, SHA2(input_password, 256), input_role, input_email, input_name, input_maquan);
    ELSE
        -- Nếu tên người dùng đã tồn tại, có thể cập nhật mật khẩu và các thông tin bổ sung
        UPDATE user
        SET password = SHA2(input_password, 256),
            role = input_role,
            email = input_email,
            name = input_name,
            maquan = input_maquan
        WHERE user_name = input_username;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `generate_random_idcoffe` (OUT `random_string` VARCHAR(3))   BEGIN
    SET random_string = CONCAT(
        CHAR(FLOOR(65 + (RAND() * 26))),  -- Chọn ngẫu nhiên ký tự chữ cái từ A-Z
        CHAR(FLOOR(48 + (RAND() * 10))),  -- Chọn ngẫu nhiên ký tự số từ 0-9
        CHAR(FLOOR(97 + (RAND() * 26)))   -- Chọn ngẫu nhiên ký tự chữ cái từ a-z
    );
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `IsUserAuthenticated` (IN `username` VARCHAR(255), IN `password` VARCHAR(255), OUT `userCount` INT)   BEGIN
    -- Mã hóa mật khẩu bằng SHA2
    DECLARE hashedPassword VARCHAR(255);
    SET hashedPassword = SHA2(password, 256); -- Bạn có thể thay đổi 256 thành 512 nếu cần

    -- Kiểm tra người dùng
    SELECT COUNT(*) INTO userCount 
    FROM user 
    WHERE user_name = username AND password = hashedPassword;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ResetPasswordAndUpdate` (IN `input_email` VARCHAR(255), OUT `plain_password` VARCHAR(16))   BEGIN
    DECLARE user_exists INT DEFAULT 0;
    DECLARE hashed_password VARCHAR(255);

    -- Kiểm tra xem email có tồn tại trong cơ sở dữ liệu không
    SELECT COUNT(*) INTO user_exists
    FROM user
    WHERE email = input_email;

    -- Nếu email tồn tại
    IF user_exists > 0 THEN
        -- Tạo mật khẩu mới ngẫu nhiên
        SET plain_password = LEFT(UUID(), 8);

        -- Mã hóa mật khẩu mới
        SET hashed_password = SHA2(plain_password, 256);

        -- Cập nhật mật khẩu đã mã hóa vào cơ sở dữ liệu
        UPDATE user
        SET password = hashed_password
        WHERE email = input_email;
    ELSE
        -- Nếu email không tồn tại, thông báo lỗi
        SIGNAL SQLSTATE '45000' 
        SET MESSAGE_TEXT = 'Email không tồn tại trong cơ sở dữ liệu.';
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdatePassword` (IN `username` VARCHAR(255), IN `newPassword` VARCHAR(255))   BEGIN
    -- Mã hóa mật khẩu mới
    DECLARE hashedPassword VARCHAR(255);
    SET hashedPassword = SHA2(newPassword, 256); -- Bạn có thể thay đổi 256 thành 512 nếu cần

    -- Cập nhật mật khẩu cho người dùng
    UPDATE user SET password = hashedPassword WHERE user_name = username;
END$$

